import './App.css';
import React from 'react';
import {StyleSheet, View} from 'react-native';

function Flex(){
  return (
  <View style={styles.index}>
    <pokeInfo/>
  </View>
)};

function pokeInfo() {
  return (
    <View style={[
      styles.container, 
      {
        backgroundColor: 'yellow',
        flex: 1  
      }
      ]}></View>)
}

const styles = StyleSheet.create({
  index: {
    flex: 1,
    flexDirection: 'row',
    backgroundColor: 'green',
    height: 700,
    padding: 20,
  },
  container: {
    padding: 10
  }
})

export default Flex;
